// SPDX-License-Identifier: Apache-2.0
pragma solidity ^0.8.7;
import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Enumerable.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Burnable.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "./ERC721Pausable.sol";
import "./GenerationalGenerativeRandomDraw.sol";
import "./SendableWithMessage.sol";

contract TheHug is Ownable, ERC721Enumerable, GenerationalGenerativeRandomDraw, ERC721Burnable, ERC721Pausable {

    using SafeMath for uint256;
    using Counters for Counters.Counter;
    Counters.Counter private _tokenIdTracker;

    uint256 private nftPrice;
    uint256 private nftMaxSupply = 5000;
    uint256 private nftMaxMint = 20;
    string private baseTokenURI;
    bool private lockURI = false;

    uint256 public promotionalMintIndex = 10001;

    event MintEvent(address to, uint256 indexed id);
    event ChangePriceEvent(uint256 price);
    event ChangeBaseUriEvent(string baseUri);


    constructor (string memory baseURI, uint256 initialPrice) ERC721("The Hug", "XO") {
        setBaseURI(baseURI);
        nftPrice = initialPrice;
    }

    modifier saleIsOpen {
        require(_totalSupply() <= nftMaxSupply, "Sale ended");
        if (_msgSender() != owner()) {
            require(!paused(), "Paused");
        }
        _;
    }

    function premintChecks(uint256 _count) private view {
        uint256 total = _totalSupply();
        require(total < nftMaxSupply, "Sold out, please buy on Opensea");
        require(total + _count <= nftMaxSupply, "Exceeds max supply");
    }

    function mint(uint256 _count) public payable saleIsOpen {
        premintChecks(_count);
        require(_count <= nftMaxMint, "Exceeds mint limit");
        require(msg.value >= price(_count), "Value below sales price");
        for (uint256 i = 0; i < _count; i++) {
            uint256 randomAvailableIndex = drawIndex();
            _mintAnElement(msg.sender, randomAvailableIndex);
        }
    }

    function promotionalMint(uint256 _count) public onlyOwner payable saleIsOpen {
        premintChecks(_count);
        // promotional max index is 1K
        require(promotionalMintIndex - 1 + _count <= 11000, "e3");
        for (uint256 i = 0; i < _count; i++) {
            _mintAnElement(msg.sender, promotionalMintIndex + i);
        }
        promotionalMintIndex += _count;
    }

    function _mintAnElement(address _to, uint256 mintId) private {
        _safeMint(_to, mintId);
        _tokenIdTracker.increment();
        emit MintEvent(_to, mintId);
    }

    function setBaseURI(string memory baseURI) public onlyOwner {
        require(!lockURI, "BaseURI is locked!");
        baseTokenURI = baseURI;
        emit ChangeBaseUriEvent(baseURI);
    }

    function CAUTION_PermanentlyLockBaseURI(uint256 password) public onlyOwner {
        if (password == 54321) {
            lockURI = true;
        }
    }

    function _baseURI() internal view virtual override returns (string memory) {
        return baseTokenURI;
    }

    function price(uint256 _count) public view returns (uint256) {
        return nftPrice.mul(_count);
    }

    function setPrice(uint256 newPrice) public onlyOwner {
        nftPrice = newPrice;
        emit ChangePriceEvent(newPrice);
    }

    function _totalSupply() internal view returns (uint) {
        return _tokenIdTracker.current();
    }

    function maxMint() public view returns (uint256) {
        return nftMaxMint;
    }

    function maxSupply() public view returns (uint256) {
        return nftMaxSupply;
    }

    function getTokenIdsOfWallet(address _owner) external view returns (uint256[] memory) {
        uint256 tokenCount = balanceOf(_owner);
        uint256[] memory tokensId = new uint256[](tokenCount);
        for (uint256 i = 0; i < tokenCount; i++) {
            tokensId[i] = tokenOfOwnerByIndex(_owner, i);
        }
        return tokensId;
    }

    function pause(bool value) public onlyOwner {
        if (value == true) {
            _pause();
            return;
        }
        _unpause();
    }

    function _beforeTokenTransfer(
        address from,
        address to,
        uint256 tokenId
    ) internal virtual override(ERC721, ERC721Enumerable, ERC721Pausable) {
        super._beforeTokenTransfer(from, to, tokenId);
    }

    function supportsInterface(bytes4 interfaceId) public view virtual override(ERC721, ERC721Enumerable) returns (bool) {
        return super.supportsInterface(interfaceId);
    }

    // SENDABLE CARD

    mapping(uint256 => string) public messages;
    event SendCardEvent(address to, string message, uint256 tokenId);

    function sendWithMessage(address to, string memory message, uint256 tokenId) public {
        require(_isApprovedOrOwner(_msgSender(), tokenId), "not owner/approved");
        safeTransferFrom(msg.sender, to, tokenId);
        emit SendCardEvent(to, message, tokenId);
    }

    function sendWithOnChainMessage(address to, string memory message, uint256 tokenId) public {
        require(_isApprovedOrOwner(_msgSender(), tokenId), "not owner/approved");
        safeTransferFrom(msg.sender, to, tokenId);
        messages[tokenId] = message;
        emit SendCardEvent(to, message, tokenId);
    }

    function setMessage(uint256 tokenId, string memory message) public {
        require(_isApprovedOrOwner(_msgSender(), tokenId), "not owner/approved");
        messages[tokenId] = message;
    }

}
